@use 'partials/base/vars' as var;

@font-face {
  font-family: "dxcRegular";
  src: url(var.$dxcFontRegular) format("woff");
  font-display: swap;
}

@font-face {
  font-family: "dxcBold";
  src: url(var.$dxcFontBold) format("woff");
  font-display: swap;
}

h1,
h2,
h3,
h4,
p {
  margin: 0;
}

h1 {
  font-size: 64px;
  line-height: 68px;
  font-family: dxcBold;
}

h2 {
  font-size: 46px;
  line-height: 54px;
  font-family: dxcBold;
}

h3 {
  font-size: 30px;
  line-height: 40px;
  font-family: dxcBold;
}

h4 {
  font-size: 16px;
  line-height: 24px;
  font-family: dxcBold;
}

p {
  font-size: 16px;
  line-height: 26px;
  font-family: dxcRegular;
}

sources.partials/components/_brochure.scss:
@use "partials/base/vars" as vars;

#brochure {
  a {
    text-decoration: none;
  }
  a:hover {
    text-decoration: underline;
  }
  .conic {
    min-width: 100vw;
    min-height: 150vh;
    display: flex;
    background: conic-gradient(from -30deg at 25% 75%, #fff 60deg, transparent 0 180deg, purple 0 240deg, transparent 0), url("img_brochure/sky.jpg") 50% / cover;

    .conic_text {
      width: 800px;
      margin-left: 5vw;
      h1 {
        padding-top: 10vh;
        font-size: 60px;

        width: 100%;
        margin-bottom: 5vh;
      }
      h2 {
        font-size: 40px;
        width: 65%;
      }
    }
  }

  section {
  }

  .content1 {
    display: grid;
    grid-template-columns: 1.4fr 300px 1fr;
    height: 100vh;
    width: 100vw;
    max-width: 1200px;
    margin: 0 0 0 auto;

    .content1-text {
      grid-column: 1;
      margin: auto;
      z-index: 2;

      h1 {
        width: 180%;
      }
      h2 {
        width: 145%;
      }
    }
    .content1-clip {
      grid-column: 2;
      background-color: white;
      clip-path: polygon(0 0, 0% 100%, 100% 0);
    }
    .content1-img {
      background-image: url("img_brochure/ladder.png");
      grid-column: 2/4;
      background-size: cover;
    }
    .content1-img2 {
      background-image: url("img_brochure/owl.png");
      grid-column: 2/4;
      background-size: cover;
    }

    h1,
    h2,
    p {
      margin-bottom: 5vh;
    }
  }
  .content1 > * {
    grid-row: 1;
  }
  .owl {
    height: 80vh;
    margin-bottom: 10vh;
    grid-template-columns: 1fr 300px 1fr;

    h2 {
      width: 135%;
    }
  }
  .content2 {
    background-color: lightgray;
    padding: 12vh 4vw;
    //display: grid;
    //grid-template-columns: repeat(1fr, 2);
    column-count: 3;
    column-width: 300px;
    p {
      margin: 0 3vw 4vh;
      font-size: 24px;
      line-height: 30px;
    }
    p:nth-child(even) {
      grid-column: 2/3;
    }
  }
  .content3 {
    background-color: white;
    p {
      font-size: 16px;
      line-height: 26px;
    }
  }
  .owl_splash {
    height: 40vw;
    width: 90vw;

    margin: 0 auto;

    h2 {
      width: 20;
    }
  }

  .content4 {
    max-width: 1200px;
    margin: 0 auto;

    h1 {
      margin-bottom: 5vh;
    }
    .txt_col {
      column-count: 3;
      column-gap: 4vw;
      column-width: 200px;
      h3 {
        margin: 4vh 0 2vh;
      }
      p {
        padding: 0 auto;
      }

      .txt_sec {
        flex-basis: 300px;
        justify-content: space-between;
        flex-grow: 1;
        margin: 2vw;
      }
    }

    img {
      width: 70vw;
    }

    .triangle_info {
      width: 40vw;
    }
  }

  .content5 {
    margin: 10vh 0 0;
    padding: 10vh 15vw 5vh;
    display: flex;
    flex-wrap: wrap;

    background-color: #d5dade;
    p {
      font-size: 24px;
      line-height: 30px;
      margin-bottom: 4vh;
    }
    .circle_infografik {
      width: 80vh;
      margin: 0 auto;
      img {
        width: 100%;
      }
    }
  }

  .content6 {
    background: conic-gradient(from -30deg at 10% 15vh, black 60deg, transparent 0 180deg, transparent 0 240deg, transparent 0);
    max-width: 1200px;
    margin: 0 auto;
    h1 {
      padding-top: 19vh;
      padding-bottom: 5vh;
    }
    p {
      column-count: 3;
      column-gap: 4vw;
      column-width: 250px;
    }
    .how_info {
      padding: 10vh 0;
    }
  }

  .content7 {
    padding: 10vh 8%;
    background-color: #dcddde;

    h1 {
      margin-bottom: 5vh;
    }
    .roi_txt {
      display: flex;
      flex-basis: 200px;

      img {
        width: 40vw;
      }
    }
    p {
      margin-right: 5vw;
    }
  }

  .content8 {
    margin: 0 0 15vh;
    margin-left: calc((100% - 1200px) / 2);
    display: grid;
    grid-template-columns: repeat(3, 1fr);

    h1,
    p {
      grid-column: 1/3;
    }
    h1 {
      margin: 10vh 0 5vh;
    }
    p {
      column-count: 2;
      column-width: 250px;
    }

    background: conic-gradient(from -30deg at 90% 60vh, #7f3f98 60deg, transparent 0 180deg, transparent 0 240deg, transparent 0);
  }

  .content9 {
    max-width: 1200px;
    margin: 0 auto 30vh;

    h1 {
      margin-bottom: 5vh;
    }
    .col3 {
      column-count: 3;
      column-gap: 3vw;
      column-width: 250px;

      h4 {
        margin-top: 2vh;
        a {
          color: black;
        }
      }
    }
  }

  footer {
    margin: 20vh auto 0;
    max-width: 1200px;
    display: grid;
    grid-template-columns: repeat(4, 1fr);

    .location {
      grid-column: 1/2;
    }
    .about {
      grid-column: 2/5;
    }
    .copyright {
      margin-top: 2vw;

      grid-column: 2/4;
    }
    .date {
      margin-top: 2vw;

      grid-column: 4/5;
    }
    .icons {
      grid-column: 1/2;

      .fa {
        padding: 20px;
        font-size: 30px;
        text-align: center;
        text-decoration: none;
        margin: 5px 2px;
      }
      .fa-facebook {
        color: blue;
      }

      .fa-twitter {
        color: #1584df;
      }
      .fa-linkedin {
        color: black;
      }
    }
  }

  @media only screen and (max-width: 800px) {
    h1 {
      font-size: 34px;
      line-height: 40px;
    }
    h2 {
      font-size: 28px;
      line-height: 32px;
    }
    h3 {
      font-size: 20px;
      line-height: 28px;
    }
    h4 {
      font-size: 16px;
      line-height: 24px;
    }
    p {
      font-size: 18px;
      line-height: 28px;
    }

    #main section {
    }
    .splash {
      margin: 0 auto;

      .conic {
        .conic_text {
          width: 600px;
          margin-right: 0;
          margin-right: 0;
          margin: 2rem 2rem 0;
          h1 {
            line-height: 4rem;
          }
          h2 {
            margin-left: 0;
            line-height: 3rem;
          }
        }
      }
    }

    .content7 {
      .roi_txt {
        flex-direction: column;

        img {
          width: 100%;
        }
      }
    }

    .content1 {
      display: flex;
      flex-wrap: wrap;
      height: 100%;
      padding: 0 2vw;
      padding-top: 10vh;

      .content1-clip {
        display: none;
      }
      .content1-img {
        width: 100%;
        height: 60vh;
      }
      .content1-text {
        margin: 0 auto;

        h1 {
          width: auto;
        }
        h2 {
          width: auto;
        }
      }
      .content1-img2 {
        width: 100%;
        height: 40vh;
      }
    }
    .owl h2 {
      width: auto;
    }

    .content8 {
      background: conic-gradient(from -30deg at 90% 35vw, #7f3f98 60deg, transparent 0 180deg, transparent 0 240deg, transparent 0);
      p {
        grid-column: 1/4;
      }
    }
    footer {
      grid-gap: 40px;

      .location {
        grid-column: 1/3;
        grid-row: 2;
      }
      .icons {
        grid-column: 3/5;
        grid-row: 2;
      }
      .about {
        grid-column: 1/5;
        grid-row: 1;
      }
      .copyright {
        grid-column: 1/5;
        grid-row: 3;
      }
    }
  }

  @media only screen and (max-width: 550px) {
    .content2 {
      display: flex;
      flex-wrap: wrap;
    }
  }

  @media only screen and (max-width: 1250px) {
    .content1 {
      padding-left: 2vw;
    }
    .content4,
    .content6,
    .content7,
    .content8,
    .content9,
    footer {
      padding-right: 2vw;
      padding-left: 2vw;
    }
    .content8 {
      margin-left: 0;
    }
  }
}

sources.partials/components/_frontpage.scss:
@use "partials/base/vars" as var;

* {
  box-sizing: border-box;
  h1 {
    font-size: clamp(1.2rem, -1.1212 + 9.697vw, 4rem);
    line-height: 68px;
  }

  h2 {
    font-size: clamp(0.8rem, -1.1212 + 6.697vw, 46px);
  }

  h3 {
    font-size: clamp(0.7rem, -1.1212 + 5.697vw, 30px);
  }
}

body {
  margin: 0;
}

#hero {
  width: 100%;
  background-color: var.$secondaryLightGray;
  height: fit-content;
  padding: 5rem;
  text-align: center;
  display: flex;
  align-items: center;
}

#video {
  width: 100%;
  background-color: var.$secondaryLightGray;
  padding: 5rem;
  text-align: center;
  video {
    margin-bottom: 2rem;
  }
}

#splash {
  .text {
    display: flex;
    justify-content: space-around;
    flex-wrap: wrap;
    align-items: center;
  }
  .logo {
    img {
      width: 50%;
    }
  }
}

#splash,
#brochure,
#partner,
#solution {
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(500px, 1fr));
  width: 100%;
  height: auto;
  height: 90vh;

  .text {
    margin: auto;
    padding: 1rem;
    p {
      margin: 3rem auto;
      overflow-wrap: break-word;
    }
    h2 {
      margin: 3rem auto;
    }
  }
  button {
    display: inline-block;
    border: none;
    padding: 22px 50px;
    margin: 2rem 0;
    text-decoration: none;
    background: var.$primaryPurple;
    color: var.$primaryWhite;
    cursor: pointer;
    text-align: center;
    transition: 0.1s;
    -webkit-appearance: none;
    -moz-appearance: none;
    font-family: dxcRegular;
    font-size: 20px;
  }

  button:hover {
    background: transparent;
    color: var.$secondaryBlack;
    border: var.$primaryPurple solid 2px;
  }
}

#splash > .image {
  background-image: url(/images_landing/Saadan-letter-DXC-din-Dynamics-365-implementering.jpg);
  background-size: cover;
  clip-path: polygon(25% 0, 100% 0, 100% 100%, 0% 100%);
}

#brochure > .image {
  background-image: url(/images_landing/dxc-photo-cloud.jpg);
  background-size: cover;
  clip-path: polygon(0 0, 100% 0, 75% 100%, 0% 100%);
}

#partner > .image {
  background-image: url(/images_landing/Saadan-letter-DXC-din-Dynamics-365-implementering.jpg);
  background-size: cover;
  clip-path: polygon(25% 0, 100% 0, 100% 100%, 0% 100%);
}

#solution > .image {
  background-image: url(/images_landing/dxc-asset-1.jpg);
  background-size: cover;
  clip-path: polygon(0 0, 100% 0, 75% 100%, 0% 100%);
}

// REUSABLES

.triangle {
  background-color: var.$primaryPurple;
  width: 46px;
  height: 46px;
  clip-path: polygon(0 0, 0% 100%, 100% 50%);
}
.header-triangle {
  display: flex;
  align-items: center;
  gap: 1rem;
}

@media (max-width: 1000px) {
  #splash,
  #brochure,
  #partner,
  #solution {
    height: auto;
    .text {
      display: block;
      margin: 1rem;
    }
    button {
      margin: auto;
      display: block;
      margin-bottom: 2rem;
    }
  }

  #splash > .image {
    height: 50vh;
    width: 100%;
    background-image: url(/images_landing/Saadan-letter-DXC-din-Dynamics-365-implementering.jpg);
    background-size: cover;
    background-position: 50% 100%;
    clip-path: none;
  }

  #brochure > .image {
    height: 50vh;
    width: 100%;
    background-image: url(/images_landing/dxc-photo-cloud.jpg);
    clip-path: none;
    grid-row: 2;
  }

  #partner > .image {
    height: 50vh;
    width: 100%;
    background-image: url(/images_landing/Saadan-letter-DXC-din-Dynamics-365-implementering.jpg);
    clip-path: none;
  }

  #solution > .image {
    height: 50vh;
    width: 100%;
    background-image: url(/images_landing/dxc-asset-1.jpg);
    clip-path: none;
    grid-row: 2;
  }
  #hero {
    padding: 2rem;
  }
  video {
    width: 450px;
    height: 350px;
    margin: auto;
  }
}

@media (max-height: 500px) {
  #splash,
  #brochure,
  #partner,
  #solution {
    height: auto;
  }
}

#blog {
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  grid-gap: 2rem;
  padding: 5rem 3rem;
  background-color: var.$secondaryLightGray;
  h1 {
    grid-column: 1 / -1;
    text-align: center;
  }
  article {
    cursor: pointer;
  }
  img {
    width: 100%;
  }
  a {
    text-decoration: none;
    color: var.$secondaryBlack;
  }
}

#contact {
  background-color: var.$secondaryBlack;
  padding: 2rem;
  h2,
  p {
    color: var.$primaryWhite;
    text-align: center;
  }
  button {
    display: block;
    border: none;
    padding: 22px 50px;
    margin: 2rem auto;
    text-decoration: none;
    background: var.$primaryPurple;
    color: var.$primaryWhite;
    cursor: pointer;
    text-align: center;
    transition: 0.1s;
    -webkit-appearance: none;
    -moz-appearance: none;
    font-family: dxcRegular;
    font-size: 20px;
  }

  button:hover {
    background: transparent;
    color: var.$primaryWhite;
    border: var.$primaryPurple solid 2px;
  }
}

sources.partials/components/_form.scss:
@use 'partials/base/vars' as var;

$breakpoint-tablet: 500px;
$breakpoint-desktop: 800px;

#contact-us {
  width: 100vw;
  height: 100vh;
  background-color: rgba(0, 0, 0, 0.3);

  display: none;
  justify-content: center;
  align-items: center;
  position: fixed;
  top: 0;
  left: 0;
  overflow: scroll;

  .form-container {
    width: 95%;
    height: 96vh;
    background-color: var.$primaryWhite;

    display: flex;
    flex-direction: column;
    align-items: flex-start;
    position: relative;
    overflow: scroll;

    @media screen and (min-width: $breakpoint-tablet) {
      width: 450px;
      min-height: 750px;
      height: 750px;
    }

    @media screen and (min-width: $breakpoint-desktop) {
      width: 750px;
      height: 750px;
    }

    .form-inner {
      width: 100%;
      height: 100%;
      padding: 3% 8% 10px 8%;
      position: relative;

      @media screen and (min-width: $breakpoint-tablet) {
        padding: 10% 10% 10px 10%;
      }

      @media screen and (min-width: $breakpoint-desktop) {
        padding: 10% 20% 10px 20%;
      }
    }

    .form-info {
      width: 100%;

      .form-heading {
        display: flex;
        align-items: center;

        .dxc-triagle {
          width: 0;
          height: 0;

          border-top: 15px solid transparent;
          border-bottom: 15px solid transparent;
          border-left: 25px solid var.$primaryPurple;
          margin-right: 10px;

          @media screen and (min-width: $breakpoint-desktop) {
            border-top: 25px solid transparent;
            border-bottom: 25px solid transparent;
            border-left: 40px solid var.$primaryPurple;
          }
        }

        h1 {
          font-size: 34px;

          @media screen and (min-width: $breakpoint-desktop) {
            font-size: 64px;
          }
        }
      }

      .info-paragraph {
        margin-top: 0px;
      }

      .help-text {
        margin-top: 0;

        @media screen and (min-width: $breakpoint-tablet) {
          margin-top: 20px;
        }
      }

      .help-link {
        margin-left: 0;
        font-family: dxcBold;
        color: var.$secondaryBlack;
        text-decoration: none;
        position: relative;
        display: inline-block;

        @media screen and (min-width: $breakpoint-tablet) {
          margin-left: 6px;
        }
      }

      .help-link::after {
        content: "";
        position: absolute;
        width: 100%;
        left: 0;
        height: 2px;
        bottom: 0px;
        background-color: var.$secondaryBlue;
        transform-origin: bottom right;
        transition: transform 0.3s ease-out;
      }
    }

    form {
      width: 100%;

      fieldset {
        margin: 0;
        padding: 0;

        display: flex;
        flex-direction: column;
        border: none;
        position: relative;
      }

      .input-container {
        width: 100%;
      }

      input {
        width: 100%;
        height: 50px;
        background-color: #f5f5f5;
        border: none;
        margin: 12px 0;
        padding: 2px 15px;
        border: 2px solid #f5f5f5;
        transition: 0.3s all ease-in-out;

        @media screen and (min-width: $breakpoint-tablet) {
          padding: 30px;
          margin: 15px 0;
        }
      }

      input:focus {
        background-color: var.$primaryWhite;
        border: 2px solid var.$secondaryBlack;
        outline: none;
      }

      .invalid {
        background-color: var.$errorFill;
        border: 2px solid red;
      }

      select {
        width: 100%;
        height: 50px;
        margin: 12px 0;
        // padding: 30px;
        text-indent: 30px;
        border: 2px solid var.$secondaryBlack;
        font-family: dxcBold;

        @media screen and (min-width: $breakpoint-tablet) {
          height: 64px;
          margin: 15px 0;
        }
      }

      select:focus {
        outline: 0;
      }

      .tos-container {
        display: flex;
        justify-content: center;
        flex-direction: column;
        align-items: flex-start;
        margin-bottom: 150px;
        // margin-top: 10px;

        .checkbox-container {
          display: flex;
          justify-content: center;
          align-items: center;
        }

        label {
          margin-left: 10px;
          font-size: 12px;
          font-family: dxcRegular;
        }
      }

      textarea {
        resize: none;
        font-family: dxcRegular;
        border: 2px solid var.$secondaryBlack;
        width: 100%;
        padding: 15px;
        font-size: 16px;
        margin: 15px 0;
      }

      input[type="checkbox"] {
        width: 25px;
        height: 25px;
        border-radius: 0;
      }

      .error {
        margin: -16px 0 0 0;
        font-size: 14px;
        color: var.$errorText;
      }

      .error-fade {
        animation: error_fade_kf 0.3s ease-out 1 forwards;
      }

      .hide {
        display: none;
      }
    }

    .form-progress {
      display: flex;
      justify-content: center;
      align-items: center;
      width: 100%;
      position: absolute;
      left: 0;
      bottom: 11%;

      @media screen and (min-width: $breakpoint-tablet) {
        bottom: 17.5%;
      }

      p {
        font-family: dxcBold;
        color: var.$secondaryDarkGray;
        letter-spacing: 2px;
        position: absolute;
        left: 10%;

        @media screen and (min-width: $breakpoint-desktop) {
          left: 20%;
        }
      }

      .dot-container {
        align-self: flex-start;
        display: flex;
        justify-content: center;
        align-items: center;

        .dot {
          width: 20px;
          height: 20px;
          margin: 0 7px;
          border-radius: 50%;
          border: 2px solid var.$secondaryLightGray;
        }

        .checked {
          animation: checked_kf 0.4s ease-in-out 1 forwards;
        }

        .not-checked {
          animation: not_checked_kf 0.4s ease-in-out 1 forwards;
        }

        .checkmark {
          width: 20px;
          height: 20px;
          margin: 0 7px;
          background-image: url("/form-images/check.svg");
        }
      }
    }

    .form-actions {
      display: flex;
      align-items: flex-end;
      justify-content: flex-end;
      position: absolute;
      right: 10%;
      bottom: 3%;

      @media screen and (min-width: $breakpoint-tablet) {
        bottom: 7%;
        right: 20%;
      }
    }

    .back,
    .next {
      padding: 12px 40px;
      border: none;
      text-transform: uppercase;
      background-color: var.$primaryPurple;
      font-family: dxcBold;
      font-size: 14px;
      color: var.$primaryWhite;
      transition: 0.4s all ease-in-out;
      cursor: pointer;

      @media screen and (min-width: $breakpoint-tablet) {
        font-size: 16px;
      }
    }

    .back {
      font-family: dxcRegular;
      background-color: var.$primaryWhite;
      color: var.$secondaryBlack;
    }

    .back:disabled {
      color: var.$secondaryLightGray;
      cursor: initial;
    }

    .complete-container {
      width: 100%;
      margin-top: 20px;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;

      @media screen and (min-width: $breakpoint-tablet) {
        margin-top: 50px;
      }

      .big-checkmark {
        width: 200px;
        height: 200px;
        border-radius: 50%;
        background-color: var.$primaryPurple;
        background-image: url("/form-images/check-white.svg");
        background-size: 65%;
        background-position: center;
        background-repeat: no-repeat;

        @media screen and (min-width: $breakpoint-tablet) {
          width: 250px;
          height: 250px;
        }
      }

      .form-actions {
        margin-top: 68px;
        align-self: flex-end;
      }
    }

    .hide {
      display: none;
    }

    .primary-exit {
      position: absolute;
      right: 25px;
      top: 25px;
      width: 18px;
      height: 18px;
      font-family: dxcRegular;
      color: var.$secondaryDarkGray;
      background-color: transparent;
      border: none;
      transition: 0.4s all ease-in-out;

      background-image: url("/form-images/close.svg");
      background-position: center;
      background-repeat: no-repeat;
      background-size: cover;
      cursor: pointer;
    }

    .primary-exit:hover {
      transform: scale(1.02);
      color: var.$secondaryBlack;
    }

    .primary-exit:focus {
      outline: none;
    }
  }
}

.open-form {
  animation: open_form_kf 0.6s ease-in-out 1 both;
}

@keyframes open_form_kf {
  0% {
    opacity: 0;
  }

  100% {
    opacity: 1;
  }
}

.hide-form {
  animation: hide_form_kf 0.6s ease-in-out 1 forwards;
}

@keyframes hide_form_kf {
  0% {
    opacity: 1;
  }

  100% {
    opacity: 0;
  }
}

@keyframes error_fade_kf {
  0% {
    transform: translateY(-5px);
    opacity: 0;
  }

  100% {
    transform: translateY(0);
    opacity: 1;
  }
}

@keyframes checked_kf {
  0% {
  }
  100% {
    background-color: var.$primaryPurple;
    border: 2px solid var.$primaryPurple;
  }
}

@keyframes not_checked_kf {
  0% {
    background-color: var.$primaryPurple;
    border: 2px solid var.$primaryPurple;
  }
  100% {
  }
}

